export default(objectContent: string[], svgContent: string[]) => {
  const now = new Date()
  const date = now.toLocaleDateString()
  const time = now.toLocaleTimeString()

  return `/* eslint-disable */

// This file was autogenerated
// Last sync: ${date}, ${time}
  
export const svgs = {
  ${objectContent.join(',\n  ')}
}
  
export enum Svg {
  ${svgContent.join(',\n  ')}
}`
}